import React from "react";
import Content from "../../../Layout/Content/Content";
import Data_Table from "../../../Helpers/Datatable";

const Users = () => {
  const columns = [
    {
      name: "Title",
      selector: (row) => row.title,
    },
    {
      name: "Year",
      selector: (row) => row.year,
    },
    {
      name: "Year",
      selector: (row) => row.year,
    },
    {
      name: "Year",
      selector: (row) => row.year,
    },
    {
      name: "Year",
      selector: (row) => row.year,
    },
    {
      name: "Year",
      selector: (row) => row.year,
    },
    {
      name: "Year",
      selector: (row) => row.year,
    },
    {
      name: "Year",
      selector: (row) => row.year,
    },
    {
      dataField: "actions",
      text: "Actions",
      formatter: (cell, row) => (
        <div style={{ width: "120px" }}>
          <div>
            <Link to={`/admin/client/edit/${row._id}`} state={row}>
              <span data-toggle="tooltip" data-placement="top" title="Edit">
                <Pencil
                  size={20}
                  color="#198754"
                  strokeWidth={2}
                  className="mx-1"
                />
              </span>
            </Link>
            {row.license_type == "1"  ?
              <Link>
                <span data-toggle="tooltip" data-placement="top" title="Delete">
                  <Trash2
                    size={20}
                    color="#d83131"
                    strokeWidth={2}
                    className="mx-1"
                    onClick={(e) => Delete_user(row._id)}
                  />
                </span>
              </Link>
              : ""}

          </div>
        </div>
      ),
    },
  ];

  const data = [
    {
      id: 1,
      title: "Beetlejuice",
      year: "1988",
    },
    {
      id: 2,
      title: "Ghostbusters",
      year: "1984",
    },
  ];

  return (
    <>
      <Content title="Users" col_size={12}>
        <Data_Table columns={columns} data={data} />
      </Content>
    </>
  );
};

export default Users;
